import React from 'react';
import '../../App.css';
import Cards from '../Cards';
import Footer from '../Footer';


function Projects(){
  return (
    <>
      <h2 className='projects'>PROJECTS</h2>
      <Cards />
      <Footer />
    </>
 );
}

export default Projects;
